import React, { Component } from 'react';
import {FaArrowLeft} from "react-icons/fa"


export default class UserPanel extends Component {
	constructor(props){
		super(props);
		this.state={
			pageType:"none",
		}
		this.changePageType.bind(this);
	}

	changePageType(typeOfPage){
		this.setState({pageType:typeOfPage});
	}

	render() {

		return(
			<div>
		      {
		        {
		          'none': <ChoosePage />,
		          'about': <AboutPage />,
		          'portfolio': <PortfolioPage />,
		          'gallery': <ListPage />,
		          'events': <ListPage />,
		          'workshops': <ListPage />,
		          'other': <OtherPage />,
		        }[this.state.pageType]
		      }
		    </div>
		)
	}
}


const ChoosePage = (props) => {
	return (
		<div className="addPageMain">
			<h3>Select what type of page you want to add</h3>
			<button type="button" className="pageEditButton" name="about" onClick={this.props.changePageType}>About Page</button>
			<button type="button" className="pageEditButton" name="portfolio" onClick={this.props.changePageType}>Portfolio Page</button>
			<button type="button" className="pageEditButton" name="gallery" onClick={this.props.changePageType}>Gallery Page</button>
			<button type="button" className="pageEditButton" name="events" onClick={this.props.changePageType}>Events Page</button>
			<button type="button" className="pageEditButton" name="workshops" onClick={this.props.changePageType}>Workshop Page</button>
			<button type="button" className="pageEditButton" name="other" onClick={this.props.changePageType}>Other Page</button>
		</div>
	)
}

const BackButton = (props) => {
	// props.clearAllData
	const goBack = ()=> {props.changePageType("none")};
	return(
		<div className="backLink" onClick={goBack}><FaArrowLeft /> Back</div>
	)
}



